import React from "react"

function Introduction() {
	return (
		<div className="intro">
			<div className="container">
				<h1>Introduction</h1>
				<h2>A little bit about myself</h2>
				<p>{"Hi! My name is Omkar Waingankar and I'm a second-year at the University of California, Berkeley."}
				</p>
			</div>
		</div>
	)
}

export default Introduction
